connection.connect();
var app = express();
app.use(cors());
app.get('/portal/recommend/article', function (req, res) {
    var sql = 'SELECT * FROM article';
    connection.query(sql, function (err, data) {
        var result = {
            code: 0,
            msg: '获取成功',
            data: data,
        };
        res.json(result);
    });
});
app.listen(3000);

